import React from 'react';

const Tooltip = ({ description }) => {
  return (
    <p
      className="card-text"
      title={description || "No Description Available"} // Use the passed description
      style={{
        whiteSpace: "nowrap",
        overflow: "hidden",
        textOverflow: "ellipsis",
      }}
    >
      {/* Content goes here */}
      description
    </p>
  );
};

export default Tooltip;
